export function Preview(attr) {
    return (
        <div className={"flex flex-column p-2"} key={attr.key}>
            <div className="flex">
                <img src={`https://image.tmdb.org/t/p/original/${attr.id}`}  alt={attr.title}/>
            </div>
            <div className="flex">
                <p>{attr.title}</p>
            </div>
        </div>
    )
}
